import axios from 'axios';
import { API } from '../config';

console.log(`${API}/signup`);

export const signup = (data) => {
  return axios({
    method: 'post',
    url: `${API}/signup`,
    data,
    headers: {
      'Accept': 'application/json',
      'Content-Type': 'application/json'
    },
  })
  .then((resp) => {
    console.log(resp.data);
    return resp.data;
  })
  .catch((err) => {
    console.log(err);
    return err;
  });
}
